script: |
  super -f text -I q1658.spq | sort > q1658.out

inputs:
  - name: q1658.spq
    data: |
      SELECT 48 + + col0 FROM tab2 (FORMAT parquet) WHERE NOT col1 >= ( + + col2 / col2 + - col1 + + ( 77 ) * 36 + 10 / - 69 );
  - name: tab2

outputs:
  - name: q1658.out
    data: |
      112
      123
      94
